‚ÄúMicro Wedding‚Äù is a pretty new term/trend that kinda surfaced this year and stuck, due to the virus-that-shall-not-be-named.

For the longest time ‚ÄúElopement‚Äù was an all encompassing term for either weddings with just the couple and up to like 10-20 ish guests(at least to me) that just incorporated a ceremony, group photos and couples photos and then sometimes a tiny bit of reception.

Micro weddings are starting to become more popular as large gatherings are discouraged. It‚Äôs exactly like it sounds too, basically most of the sweet moments and celebrations of a large scale wedding set to a smaller scale with way fewer people.

Usually a guest count of 25-30 or less. A much shorter and simple timeline and a bit more relaxed than a wedding.

McKenzie and Nathaniel knew they wanted something intimate from the get-go and loved the idea of the luxury elopement @atouchofsaigeevents and I brainstormed together back in July.

They decided it was the perfect fit for their August wedding and we went to work planning out this sweet day for their friends and family.

